import User from "./User"

const Users = ({ users, removeUser }) => {

  if (users.length) {
    return (
      <div>
        {users.map(user => (
          <User user={user} key={user.id} removeUser={removeUser} />
        ))}
      </div>)
  }
  else {
    return (<div className="user">
      <h2>Нет пользователей</h2>
    </div>)
  }

}

export default Users
